import React from 'react';
import './App.scss';
import SideBar from './components/SideBar/SideBar'
import Folders from './components/Folders/Folders'
import Files from './components/Files/Files'


function App() {
  return (
    <div className="App">
      <SideBar />
      <Folders />
      <Files />
    </div>
  );
}

export default App;
